import { useState } from 'react';

const Chat: React.FC = () => {

    return (
        <div className="chat">
        <p>Chat</p>
            <ul id="messages">
            </ul>
            <form action="">
                <input type="text" />
                <button type="submit">Send</button>
            </form>

        </div>
    )
}

export default Chat;
